INSERT INTO `catalog_pages` VALUES ('13', '12', 'Perros', '1', '0', '1', '1', '24', '0', 'petpage', 'catalog_pet_headline1_es', '', 'Hocicos peludos, zarpas y ladridos. Ests a punto de entrar al mundo de los perros! Una adorable y fiel mascota te estar esperando siempre y menear la cola en cuanto te vea. Encuentra un nuevo amigo aqu mismo!', '', '', '', '', '0', '9');
INSERT INTO `catalog_pages` VALUES ('14', '12', 'Gatos', '1', '0', '1', '1', '20', '0', 'petpage', 'catalog_pet_headline1_es', '', 'Pelusas, bigotes, maullidos y ronroneos. Ests a punto de entrar en el mundo de los gatos! Estas pequeas y peludas criaturas te darn la mejor de las compaas siempre que cuides de ellas. Encuentra aqu mismo a tu nuevo amigo!', '', '', '', '', '0', '10');
INSERT INTO `catalog_pages` VALUES ('15', '12', 'Cocodrilos', '1', '0', '1', '1', '22', '0', 'petpage', 'catalog_pet_headline1_es', '', 'Piel spera, gruidos y una dentadura de acero. Ests a punto de entrar en el mundo de los cocodrilos! La mejor manera de poner los pelos de punta a tus amigos la tienes si te haces con uno de mascota. A qu esperas para hacerlo?', '', '', '', '', '0', '11');
INSERT INTO `catalog_pages` VALUES ('16', '12', 'Osos', '1', '0', '1', '1', '68', '0', 'petpage', 'catalog_pet_headline1_es', '', 'ste es un largo y pesado mamfero que camina sobre la planta de sus pies y cuenta con una gruesa piel. La mayora de los osos son omnvoros, tenlo en cuenta a la hora de alimentarle. Enamrate de la gran variedad que aqu te presentamos, desde Grizzlies a Osos Polares.', '', '', '', '', '0', '8');
INSERT INTO `catalog_pages` VALUES ('17', '12', 'Terrier', '1', '0', '1', '1', '66', '0', 'petpage', 'catalog_pet_headline1_es', '', 'Una de las razas ms antiguas de perros es la de los Terrier. Originales de las altas montaas de Escocia, son reconocidos como unos de los primeros perros utilizados como fuerza de trabajo debido a su capacidad para seguir rastros.', '', '', '', '', '0', '7');
INSERT INTO `catalog_pages` VALUES ('18', '12', 'Jabales', '1', '0', '1', '1', '67', '0', 'petpage', 'catalog_pet_headline1_es', '', 'El Jabal es una especia salvaje de cerdo, e incluye al menos hasta 16 subespecies.', '', '', '', '', '0', '6');
INSERT INTO `catalog_pages` VALUES ('19', '12', 'Rinocerontes', '1', '0', '1', '1', '77', '0', 'petpage', 'catalog_pet_headline1_es', '', 'El Rinoceronte es un herbvoro africano que puede llegar a pesar ms de una tonelada. Quiz en la naturaleza sean de trato difcil, pero en Habbo son de lo ms amistosos.', '', '', '', '', '0', '5');
INSERT INTO `catalog_pages` VALUES ('20', '12', 'Leones', '1', '0', '1', '1', '76', '0', 'petpage', 'catalog_pet_headline1_es', '', 'Fiero depredador en plena naturaleza, el len se ha vuelto manso para convertirse en tu fiel amigo en Habbo Hotel.', '', '', '', '', '0', '4');
INSERT INTO `catalog_pages` VALUES ('21', '12', 'Araas', '1', '0', '1', '1', '95', '0', 'petpage', '', '', 'Su picadura es legendaria, pero no aconsejamos probarla. Hablamos de la Araa, una nueva Mascota que ya puede hacerte compaa en tu Sala... si no le tienes miedo.', '', '', '', '', '0', '3');
INSERT INTO `catalog_pages` VALUES ('22', '12', 'Ranas', '1', '0', '1', '1', '97', '0', 'petpage', 'catalog_pet_headline1_es', '', 'Cuentas con una buena charca en una de tus Salas Privadas? Entonces no puede faltar en ella una de las Ranas que aqu te presentamos. Con cul te quedas?', '', '', '', '', '0', '2');
