INSERT INTO `catalog_pages` VALUES ('31', '25', 'Complementos', '1', '0', '1', '1', '85', '5', 'defaultpage', 'catalog_wired_header5_es', 'ctlg_pic_wired_support_furniture', 'Utiliza estos Furni simplemente para dar algo ms de sabor a tu Sala Wired. Necesitars apilar un Complemento sobre un Causante, un Efecto y una Condicin para que funcione.', '', 'Haz clic en cada objeto para ver de qu van los Complementos!', '', '', '0', '4');
