INSERT INTO `catalog_pages` VALUES ('33', '32', 'Reglas Banzai', '1', '0', '1', '1', '42', '0', 'instructions', 'catalog_battleBanzai_header_en', 'icon_78', 'Lee las instrucciones y descubre cmo jugar al Battle Banzai. No hay tiempo que perder!', '', 'Cmo crear tu propia Sala de Battle Banzai?{separe}1. Ve a tu Sala|2. Coloca casillas Banzai en el suelo y vallas para limitar el campo de juego|3. Aade un Vestuario Banzai en cada lado para cada equipo. Hay cuatro opciones: azul, rojo, amarillo y verde|4. Coloca el Contador y los Marcadores en el terreno de juego|5. Una vez est todo listo, di a tus amigos que se preparen|6. Haz clic en el Contador e inicia el juego', '', '', '0', '8');
INSERT INTO `catalog_pages` VALUES ('34', '32', 'Ftbol', '1', '0', '1', '1', '56', '0', 'defaultpage', 'catalog_football_001', 'football_teaser', 'El deporte rey no poda faltar en Habbo y es hora de que demuestres que con el baln en los pies no hay rival al que no puedas batir.', '', '', '', '', '0', '9');
INSERT INTO `catalog_pages` VALUES ('35', '32', 'Reglas Ftbol', '1', '0', '1', '1', '42', '0', 'instructions', 'catalog_football_001', 'icon_56', 'Monta un campo y coloca en sus laterales tantos Vestuarios como equipos quieras que participan en el juego. Ah, y no te olvides del Baln, claro. Dominar este juego no lleva mucho tiempo!', 'Sabas que las mascotas tambin pueden jugar? Haz la prueba!', 'Aqu tienes algunos consejos:{separe}1. Haz un disparo avanzando hasta la casilla en la que est el Baln, o da un pase atravesando esa misma casilla.|2. Hazte con el control del baln avanzando hasta una casilla junto a este y luego haciendo doble clic sobre l.|3. Haz que rebote el Baln ante obstculos como otros Furni, jugadores o vallas.', '', '', '0', '10');
INSERT INTO `catalog_pages` VALUES ('36', '32', 'Freeze', '1', '0', '1', '1', '87', '0', 'defaultpage', 'catalog_freeze_en', 'ctlg_teaser_es', 'Seguro que despus de participar en este juego ya no te gusta tanto la nieve... Compite por equipos y consigue que impacten el mayor nmero de bolas de nieve posibles sobre tus contrincantes. Son como autnticas bombas!', '', '', '', '', '0', '5');
INSERT INTO `catalog_pages` VALUES ('37', '32', 'Reglas Freeze', '1', '0', '1', '1', '42', '0', 'instructions', 'catalog_freeze_en', 'ctlg_teaser_es', 'Descubre aqu cmo crear un recinto donde poder jugar a \'Freeze\' y, adems, cmo jugar exactamente.', 'Recuerda: pon siempre los Bloques sobre una Casilla Freeze! Si no, no funcionarn.', 'As es como puedes crear tu propia partida!{separe}1. Ve a tu Sala.|2. Coloca Casillas y Bloques Freeze en el suelo y utiliza Paredes para delimitar el terreno de juego. Pon siempre los Bloques sobre una Casilla!|3. Aade un acceso para cada equipo en tu Sala. Puede haber un mximo de cuatro equipos: amarillo, azul, rojo y verde.|4. Coloca un Contador y un Marcador en el terreno de juego.|5. Finalmente, coloca una Casilla de Salida fuera del terreno de juego. Ah sern enviados los jugadores cuando ya no les quede ninguna vida.|6. Listo? Llama a tus amigos y deja que elijan equipo. Cada uno puede tener hasta un mximo de cinco jugadores.|7. Haz clic en el Contador y deja que empiece el juego.', '', '', '0', '6');
INSERT INTO `catalog_pages` VALUES ('38', '32', 'Puzzles', '1', '0', '1', '1', '99', '0', 'defaultpage', 'puzzlebox_headline1', 'puzzlebox_teaser1', 'Dificulta el tipo de laberintos que construyes incluyendo Furni que te permitir crear incluso puzzles en los que, para conseguir abrir una puerta, antes tengas que desplazar una Caja hasta un lugar concreto.', '', '', '', '', '0', '3');
INSERT INTO `catalog_pages` VALUES ('39', '32', 'Reglas Puzzles', '1', '0', '1', '1', '42', '0', 'instructions', 'puzzlebox_headline1', 'icon_99', 'Este tipo de Furni te ayudar a crear complicados laberintos. Simplemente habr que situarse junto a una Caja y hacer doble clic sobre ella para empujarla.', '', 'Cmo usar la Caja para Puzzles:{separe}1. Compra el Divisor para Puzzles + varias Cajas para Puzzles y construye un laberinto.|2. Emplea la Condicin WIRED \'Furni encima\' junto a Casillas de Presin, y as cuando las Cajas se empujen hacia unos lugares concretos, varias puertas podran abrirse, por ejemplo.|3. Deja que tus amigos prueben el laberinto. Para mover las Cajas debern hacer clic sobre ellas en varias direcciones hasta encontrar un camino para salir del laberinto.', '', '', '0', '4');
INSERT INTO `catalog_pages` VALUES ('40', '32', 'Patinaje sobre Ruedas', '1', '0', '1', '1', '94', '0', 'defaultpage', 'catalog_header_bling_en', 'catalog_teaser_rollerblades', '', '', '', '', '', '0', '2');
INSERT INTO `catalog_pages` VALUES ('41', '32', 'T la llevas!', '1', '0', '1', '1', '88', '0', 'defaultpage', 'catalog_tag_br', 'catalog_teaser_xm10_skate', 'Crea tu propio juego de \'t la llevas\', \'pega-pega\' o \'pilla-pilla\'. Para ponerte los patines basta con pisar el Hielo, pero para el juego, necesitas que tambin haya una Luz de Salida sobre el Hielo.', '', '', '', '', '0', '1');
