INSERT INTO `catalog_pages` VALUES ('73', '50', 'Mercadillo', '1', '0', '1', '1', '69', '0', 'instructions', 'catalog_marketplace_header_es', '', 'El Habbo Mercadillo es una forma segura y conveniente de comprar y vender objetos en Habbo', '', 'Cmo funciona el Habbo Mercadillo?{separe}Vender objetos: |Puedes vender cualquiera que sea tradeable seleccionndolo en tu Inventario y haciendo clic en \'Vender en Mercadillo\', incluidos los que en ese momento estn a la venta en la Tienda, excepto Mascotas, Teleports y objetos comprados con Pxeles.||Comprar objetos:|Selecciona el objeto deseado entre las \'Ofertas\' y haz clic en \'Comprar\'.', '', '', '0', '0');
